import { ReactComponent as VercelIcon } from './vercelIcon.svg';

const BtnWeb = ({ link }) => {
    return (
        <a href={link} target="_blank" rel="noreferrer" className="btn-outline">
            <VercelIcon />
            Vercel
        </a>
    );
};

export default BtnWeb;
